\begin{abstract}
The paper is devoted to investigation of some properties of
$[L]$-homotopy groups. It is proved, in particular, that for any finite
$CW$-complex $L$, satisfying
double inequality $[S^n] < [L] \le [S^{n+1}]$,
$\fnd = \Z$. Here $[L]$ denotes extension type of complex $L$ and
$\group$ denotes $n$-th $[L]$-homotopy group of $X$.
\end{abstract}

